import { Table } from "antd";
const LeadersTable = () => {
  const columns = [
    {
      title: "ציון ממוצע סופי",
      dataIndex: "overallAvgGrade",
      sorter: (a, b) => a.overallAvgGrade - b.overallAvgGrade,
    },
    {
      title: "ציון ממוצע למטלה",
      dataIndex: "avgGradePerAssignment",
      sorter: (a, b) => a.avgGradePerAssignment - b.avgGradePerAssignment,
    },
    {
      title: "עיר",
      dataIndex: "city",
      sorter: (a, b) => a.age - b.age,
    },
    {
      title: "תלמידים",
      dataIndex: "howManyStudents",
      sorter: (a, b) => a.howManyStudents - b.howManyStudents,
    },

    {
      title: "כיתה",
      dataIndex: "grade",
      sorter: (a, b) => a.age - b.age,
    },

    {
      title: "בית ספר",
      dataIndex: "school",
      sorter: (a, b) => a.age - b.age,
    },
    {
      title: "מקום",
      dataIndex: "place",
      sorter: (a, b) => a.place - b.place,
    },
  ];

  const data = [
    {
      key: 1,
      place: 1,
      school: "John Brown",
      grade: "ו-2",
      city: "בת ים",
      howManyStudents: 23,
      avgGradePerAssignment: 95,
      overallAvgGrade: 90,
    },
    {
      key: 2,
      place: 2,
      school: "John Brown",
      grade: "ו-4",
      city: "חיפה",
      howManyStudents: 43,
      avgGradePerAssignment: 65,
      overallAvgGrade: 50,
    },
  ];

  return (
    <div>
      <table style={{width : "80%",margin: "50px auto",borderRadius:"25px",boxShadow:"0 0 8px black"}}>
          <thead>
              <tr>
                  <td>ציון ממוצע סופי</td>
                  <td>ציון ממוצע למטלה</td>
                  <td>עיר</td>
                  <td>תלמידים</td>
                  <td>כיתה</td>
                  <td>בית ספר</td>
                  <td>מקום</td>
              </tr>
          </thead>
          <tbody>
            {data.map(row => {
                return (
                    <tr>
                    <td>{row.overallAvgGrade}</td>
                    <td>{row.avgGradePerAssignment}</td>
                    <td>{row.city}</td>
                    <td>{row.howManyStudents}</td>
                    <td>{row.grade}</td>
                    <td>{row.school}</td>
                    <td>{row.place}</td>
                </tr>

                );
            })}
          </tbody>
      </table>
    </div>
  );
};

export default LeadersTable;
